  Code = "class Solution:\n    def maximumStrongPairXor(self, nums: List[int]) -> int:\n        max_xor = 0\n        for num1, num2 in itertools.permutations(nums, 2):\n            if abs(num2 - num1) <= min(num1, num2):\n                max_xor = max(max_xor, num1 ^ num2)\n        return max_xor "
